import Container from 'react-bootstrap/Container';

const certificates = [
    {title: "CISCO CCNAv7", subtitle: "Introduction to Networks", description: ""},
    {title: "CISCO IoT", subtitle: "Introduction to IoT", description: ""},
    {title: "CISCO CyberSecurity", subtitle: "Introduction to Cybersecurity", description: ""},
    {title: "HackersGen", subtitle: "Complete Linux/Ubuntu course", description: ""},

    <Card
        bg={link}
        key={link}
        text={link === 'light' ? 'link' : 'white'}
        style={{ width: '18rem' }}
        className="mb-2"
    >
        <Card.Header>Header</Card.Header>
        <Card.Body>
            <Card.Title>{link} Card Title </Card.Title>
            <Card.Text>
                Some quick example text to build on the card title and make up the
                bulk of the card's content.
            </Card.Text>
        </Card.Body>
    </Card>
];

function CertificationsLanding() {
    return (
        <Container>
            <div className="row flex-wrap px-3 my-5">
                
            </div>
        </Container>
    );
}

export default CertificationsLanding;
